import React, { Component } from 'react'


export class Migration extends Component {
    render() {
        return (
            <React.Fragment>
           
                <div className="header">
                Java Migration Service 
                </div>
                <div className="inner_text">
                Looking to have your business platform<br/>
                 migrated to the Java-based framework to<br/>
                  become future-proof? We’re listening! Spineor<br/>
                   can assist you in migration services to <br/>
                   ensure a smooth and efficient workflow.<br/>
                    Lorem ipsum, or lipsum as it is sometimes<br/>
                     known, is dummy text used in laying out <br/>
                     print, graphic or web designs. The passage is<br/>
                      attributed to an unknown 
                </div>
                <div className="button_outer"></div>
                <div className="button_inner">Request A Free Consultation</div>
                <div className="javadev_image"></div>
                <div className="lock_image"></div>
                <div className="maintain_header">Java Maintenance And Support</div>
                <div className="maintain_text">
                Apps run smoothly if they’re maintained<br/>
                 from time to time. Our Java application<br/>
                  maintenance support ensures that your<br/>
                   apps always run at their peak performance<br/>
                    so your business won’t have to suffer.<br/>
                     Lorem ipsum, or lipsum as it is sometimes<br/>
                      known, is dummy text used in laying out<br/> 
                      print, graphic or web designs. The passage<br/>
                       is attributed to an unknown 
                </div>
                <div className="maintain_outer_button"></div>
                <div className="maintain_inner_button"> Request A Free Consultation</div>
                <style jsx>{`
                .header{
                    position: absolute;
                    width: 430px;
                    height: 49px;
                    left: 101px;
                    top: 2419px;
                    font-family: Roboto;
                    font-style: normal;
                    font-weight: 500;
                    font-size: 42px;
                    line-height: 49px;
                    color: #222222;
                }
                .inner_text{
                    position: absolute;
                    width: 476px;
                    height: 244px;
                    left: 101px;
                    top: 2483px;
                    font-family: Roboto;
                    font-style: normal;
                    font-weight: 300;
                    font-size: 24px;
                    line-height: 28px;
                    color: #444444;
                }
                .button_outer{
                    position: absolute;
                    width: 284px;
                    height: 50px;
                    left: 101px;
                    top: 2778px;
                    background: #FFFFFF;
                    border: 2px solid #184A88;
                    box-sizing: border-box;
                    border-radius: 4px;
                }
                .button_inner{
                    position: absolute;
                    width: 202px;
                    height: 19px;
                    left: 139px;
                    top: 2793px;
                    font-family: Roboto;
                    font-style: normal;
                    font-weight: normal;
                    font-size: 16px;
                    line-height: 19px;
                    display: flex;
                    align-items: center;
                    text-align: center;
                    color: #184A88;
                }
                .javadev_image{
                    position: absolute;
                    width: 662px;
                    height: 510px;
                    left: 622px;
                    top: 2340px;
                    background: url(javadev.png);
                    border:2px solid  black
                }
                .lock_image{
                    position: absolute;
                    width: 596px;
                    height: 343px;
                    left: 26px;
                    top: 3119px;
                    background: url(Untitled-1.png);
                    border:2px solid black
                }
                .maintain_header{
                    position: absolute;
                    width: 355px;
                    height: 98px;
                    left: 650px;
                    top: 3051px;
                    font-family: Roboto;
                    font-style: normal;
                    font-weight: 500;
                    font-size: 42px;
                    line-height: 49px;
                    color: #222222;     
                }
                .maintain_text{
                    position: absolute;
                    width: 464px;
                    height: 260px;
                    left: 650px;
                    top: 3167px;
                    font-family: Roboto;
                    font-style: normal;
                    font-weight: 300;
                    font-size: 24px;
                    line-height: 28px;
                    color: #444444;
                }
                .maintain_outer_button{
                    position: absolute;
                    width: 284px;
                    height: 50px;
                    left: 650px;
                    top: 3453px;
                    background: #FFFFFF;
                    border: 2px solid #184A88;
                    box-sizing: border-box;
                    border-radius: 4px;
                }
                .maintain_inner_button{
                    position: absolute;
                    width: 202px;
                    height: 19px;
                    left: 688px;
                    top: 3468px;
                    font-family: Roboto;
                    font-style: normal;
                    font-weight: normal;
                    font-size: 16px;
                    line-height: 19px;
                    display: flex;
                    align-items: center;
                    text-align: center;
                    color: #184A88;
                }
                `}</style>
            </React.Fragment>
        )
    }
}

export default Migration
